import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import NotFound from "pages/NotFound";
import FrameOne from "pages/FrameOne";
import MySubmissions from "/MySubmissions";
import ReportsPage from "pages/ReportsPage"; // Import ReportsPage page

const ProjectRoutes = () => {
  return (
    <React.Suspense fallback={<>Loading...</>}>
      <Router>
        <Routes>
          <Route path="/" element={<Navigate to="/frameone" />} />
          <Route path="/frameone" element={<FrameOne />} />
          {/* Create a route for the new page */}
          <Route path="/MySubmissions" element={<MySubmissions />} />
          {/* Create a route for the reports page */}
          <Route path="/reports" element={<ReportsPage />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
      </Router>
    </React.Suspense>
  );
};

export default ProjectRoutes;
